import React, { useState, useEffect } from 'react';
import axios from 'axios';
import NotificationBell from '../components/Notifications/NotificationBell.tsx';

interface FinancialAdvisorDashboardProps {
  user: any;
  onLogout: () => void;
}

interface FinancialSession {
  _id: string;
  scheduledDate: string;
  duration: number;
  sessionType: string;
  format: string;
  status: 'scheduled' | 'in-progress' | 'completed' | 'cancelled' | 'no-show';
  client: {
    _id: string;
    name: string;
    email: string;
    department: string;
  };
  sessionRecord?: {
    mainTopics: string[];
    recommendations: string[];
    followUpNeeded: boolean;
    nextSessionDate?: string;
  };
}

interface DashboardStats {
  weeklyScheduled: number;
  totalClients: number;
  monthlyStats: Array<{
    _id: string;
    count: number;
  }>;
  satisfaction: {
    avgRating: number;
    totalFeedbacks: number;
  };
}

const FinancialAdvisorDashboard: React.FC<FinancialAdvisorDashboardProps> = ({ user, onLogout }) => {
  const [loading, setLoading] = useState(true);
  const [sessions, setSessions] = useState<FinancialSession[]>([]);
  const [activeTab, setActiveTab] = useState('schedule');

  useEffect(() => {
    loadDashboardData();
  }, []);

  const loadDashboardData = async () => {
    try {
      setLoading(true);
      // Ïû¨Î¨¥ÏÉÅÎã¥ ÏÑ∏ÏÖò Îç∞Ïù¥ÌÑ∞ Î°úÎìú Î°úÏßÅ Ï∂îÍ∞Ä ÏòàÏ†ï
      setSessions([]);
    } catch (error) {
      console.error('Îç∞Ïù¥ÌÑ∞ Î°úÎìú Ïã§Ìå®:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div style={{ 
        minHeight: '100vh', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'center',
        backgroundColor: '#f8fafc'
      }}>
        <div style={{ textAlign: 'center' }}>
          <div style={{ 
            width: '50px', 
            height: '50px', 
            border: '3px solid #f3f3f3',
            borderTop: '3px solid #10b981',
            borderRadius: '50%',
            animation: 'spin 1s linear infinite',
            margin: '0 auto 20px'
          }}></div>
          <p style={{ color: '#6b7280', fontSize: '16px' }}>Ïû¨Î¨¥ÏÉÅÎã¥ÏÇ¨ ÎåÄÏãúÎ≥¥Îìú Î°úÎî© Ï§ë...</p>
        </div>
      </div>
    );
  }

  return (
    <div style={{ 
      minHeight: '100vh', 
      backgroundColor: '#f8fafc',
      fontFamily: '"Segoe UI", "Malgun Gothic", sans-serif'
    }}>
      {/* Ìó§Îçî */}
      <div style={{
        background: 'linear-gradient(135deg, #10b981 0%, #059669 100%)',
        color: 'white',
        padding: '20px 30px',
        boxShadow: '0 4px 12px rgba(16, 185, 129, 0.2)'
      }}>
        <div style={{ 
          display: 'flex', 
          justifyContent: 'space-between', 
          alignItems: 'center',
          maxWidth: '1200px',
          margin: '0 auto'
        }}>
          <div>
            <h1 style={{ 
              margin: '0 0 5px 0', 
              fontSize: '28px', 
              fontWeight: '700'
            }}>
              üí∞ Ïû¨Î¨¥ÏÉÅÎã¥ÏÇ¨ ÎåÄÏãúÎ≥¥Îìú
            </h1>
            <p style={{ 
              margin: '0', 
              fontSize: '16px', 
              opacity: 0.9 
            }}>
              ÏïàÎÖïÌïòÏÑ∏Ïöî, {user.name} Ïû¨Î¨¥ÏÉÅÎã¥ÏÇ¨Îãò!
            </p>
          </div>

          <div style={{ display: 'flex', alignItems: 'center', gap: '15px' }}>
            <NotificationBell />
            <button
              onClick={onLogout}
              style={{
                background: 'rgba(255, 255, 255, 0.2)',
                color: 'white',
                border: 'none',
                padding: '10px 20px',
                borderRadius: '8px',
                cursor: 'pointer',
